import React from 'react'

var loginCSS= require('./login.css')

export default class LoginPage extends React.Component{
    render(){
        return(
            <div className="login">
            <h3>用户名</h3>
            <p>密码</p>
            <button>登录</button>
            </div>
        )
    }
}
